import React, { Component } from "react";

class MyAccount extends Component {
  render() {
    return (
      <div style={{ minHeight: 600 }}>
        <span style={{ fontSize: 25, fontWeight: "bold", marginTop: 20 }}>
          My Account
        </span>
      </div>
    );
  }
}

export default MyAccount;
